import React from 'react';
// Styles
import { InfoStyles } from './Info.styles';

const Info = () => (
  <InfoStyles>
    <p>
      洞察者號(InSight)測量火星表明Elysium 平原的天氣,包括氣溫,風向,氣壓
       is taking daily weather measurements (temperature, wind, pressure)
      on the surface of Mars at Elysium Planitia, a flat, smooth plain near
      Mars’ equator.
    </p>
    <p>
      This is only a part of InSight’s mission.{' '}
      <a href='https://mars.nasa.gov/insight/mission/overview/'>Click here</a>
      to find out more.
    </p>
  </InfoStyles>
);

export default Info;
